import React, { Component } from 'react';
import PropTypes from 'prop-types';

export default class TodoContent extends Component {
    render() {
        return (
            <div className='contentLayout'>
                <h2>Create Contact</h2>
                <button>Add</button>
            </div>
        )
    }
}
